import {
    getProductDate_DATA,
} from '../action/Product';

const initialState = {
    getProductDate: [],
};


const reducer = (state = initialState, action) => {
    switch (action.type) {
        case getProductDate_DATA:
            return getProductDate(state, action);
    }
};

const getProductDate = (state, action) => {
    const setData = {
      ...state,
      getProductDate: action.data,
    };
    return setData;
  };

export default reducer;
